cool: Python provides a solution for this problem as well. It’s the __radd__ method. It works like this: Python tries to evaluate the expression “5 + Length(3, ‘yd’)“. First it calls int.__add__(5,Length(3, ‘yd’)), which will raise an exception. After this it will try to invoke Length.__radd__(Length(3, “yd”), 5). It’s easy to recognize that the implementation of __radd__ is analogue to __add__:

   def __radd__(self, other):
        if type(other) == int or type(other) == float:
            l = self.Converse2Metres() + otherLength.__radd__(Length(3, “yd”), 5)
        else:
            l = self.Converse2Metres() + other.Converse2Metres()
        return Length(l / Length.__metric[self.unit], self.unit )

It’s advisable to make use of the __add__ method in the __radd__ method:

   def __radd__(self, other):
        return Length.__add__(self,other)  

